// ActionButtons.js
import React from "react";

function ActionButtons() {
  return (
    <div>
      <a
        href="#about"
        className="cta-btn-fill"
        style={{ margin: "0 10px 10px 0" }}
      >
        Learn more
      </a>
      <a href="#contact" className="cta-btn">
        Get in contact
      </a>
    </div>
  );
}

export default ActionButtons;
